        MUST say that minitest is *very* readable / understandable\n     compared
        to the ''other two'' options we looked at. Nicely done and\n     thank you
        for helping us keep our mental sanity.\"\n\n    -- Wayne E. Seguin\n\nminitest/test
        is a small and incredibly fast unit testing framework.\nIt provides a rich
        set of assertions to make your tests clean and\nreadable.\n\nminitest/spec
        is a functionally complete spec engine. It hooks onto\nminitest/test and seamlessly
        bridges test assertions over to spec\nexpectations.\n\nminitest/benchmark
        is an awesome way to assert the performance of your\nalgorithms in a repeatable
        manner. Now you can assert that your newb\nco-worker doesn''t replace your
        linear algorithm with an exponential\none!\n\nminitest/mock by Steven Baker,
        is a beautifully tiny mock (and stub)\nobject framework.\n\nminitest/pride
